  false,\n\t\"url\": null,\n\t\"notes\": \"Fourteen miles of shoreline are open to
  surf fishing on St. Vincent National Wildlife Refuge.  Freshwater fishing for largemouth
  bass, bluegill, and redear sunfish occurs on the island in a series of 6 ponds and
  a stream.  Chemical characteristics, conductance measurements, fish populations,
  scale samples, and proportional stock densities are summarized for each body of
  water on the refuge.  It is recommended that fishing continue under present rule
  and regulation; however, cattails need to be controlled.\",\n\t\"license_title\":
